import App from "./App";
import React from "react";
import ReactDOM from "react-dom";

ReactDOM.render(
	<React.StrictMode>
		<ThemeProvider
			theme={{
				breakpoints: {
					xs: 0,
					sm: 576,
					md: 768,
					lg: 992,
					xl: 1200,
				},
			}}
		>
			<App />
		</ThemeProvider>
	</React.StrictMode>,
	document.getElementById("root")
);
